import React from 'react'

export default function CaseStudyArchived( { projectName, projectDescription, link = "#", newWindow}) {
  return (
    <a href={link} className="case-study-archived" target={newWindow ? "_blank" : null}>
        <h1 className="archived-title">{projectName}</h1>
        <p>{projectDescription}</p>
    </a>
    )
}
